import 'react-native-gesture-handler';
import React from "react";
import { StatusBar } from "expo-status-bar";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import AuthPage from "./src/routes/AuthPage";
import FlashCard from "./src/routes/Flashcard";
import ListFlashCards from "./src/routes/ListFlasCards";
import { enableScreens } from 'react-native-screens';


enableScreens();

import { NavigationContainer } from '@react-navigation/native';
const Stack = createNativeStackNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Screen name={"me-connecter"} component={AuthPage} />
      <Stack.Screen name={"mes-fiches"} component={ListFlashCards} />
      <Stack.Screen name={"une-fiche"} component={FlashCard} />
    </NavigationContainer>
  );
}
